">\r\n                    <h3 style=\"border-top:2px solid white; border-bottom:2px solid white; padding:10px;\">Estadio</h3>\r\n                    <p>{{info.estadio}}</p>\r\n                  </div>\r\n                </div>\r\n              </div>\r\n\r\n            </div>\r\n            <div class=\"col-sm-2\">\r\n              <div class=\"cuadro_intro_hover \" style=\"background-color:#cccccc;\">\r\n                <p style=\"text-align:center;\">\r\n                  <img src=\"https://image.ibb.co/jCGNDy/trofeo.jpg\" alt=\"trofeo\" class=\"img-responsive\">\r\n                </p>\r\n                <div class=\"caption\">\r\n                  <div class=\"blur\"></div>\r\n                  <div class=\"caption-text\">\r\n                    <h3 style=\"border-top:2px solid white; border-bottom:2px solid white; padding:10px;\">Titulos</h3>\r\n                    <p>{{info.titulos}}</p>\r\n                  </div>\r\n                </div>\r\n              </div>\r\n\r\n            </div>\r\n            <div class=\"col-sm-2\">\r\n              <div class=\"cuadro_intro_hover\" style=\"background-color:#cccccc;\">\r\n                <p style=\"text-align:center;\">\r\n                  <img src=\"https://image.ibb.co/gVK1Ty/R2_IXWJLSHNENZGUAEYTKI4_FR24.jpg\" alt=\"2754548\" class=\"img-responsive\">\r\n                </p>\r\n                <div class=\"caption\">\r\n                  <div class=\"blur\"></div>\r\n                  <div class=\"caption-text\">\r\n                    <h3 style=\"border-top:2px solid white; border-bottom:2px solid white; padding:10px;\">DT</h3>\r\n                    <p>{{info.dt}}</p>\r\n                  </div>\r\n                </div>\r\n              </div>\r\n\r\n            </div>\r\n          </div>\r\n        </div>\r\n\r\n      </div>\r\n      <div class=\"col-sm-3\">\r\n        <div class=\"row text-center\">\r\n          <a href=\"https://www.facebook.com/ADSantosOficial/\" target=\"_blank\" class=\"fa fa-facebook\"></a>\r\n          <a href=\"\" target=\"_blank\" class=\"fa fa-twitter\"></a>\r\n          <a href=\"\" target=\"_blank\" class=\"fa fa-instagram\"></a>\r\n        </div>\r\n      </div>\r\n    </div>\r\n\r\n    <div style=\"padding-top: 50px\" class=\"row\">\r\n      <div class=\"col-sm-5\">\r\n        <table class=\"table\">\r\n          <tr>\r\n            <th>Jornada</th>\r\n            <th>Equipo Local</th>\r\n            <th>Goles</th>\r\n            <th>Goles</th>\r\n            <th>Equipo visita</th>\r\n          </tr>\r\n          <tr *ngFor=\"let result of resultados.resultados\">\r\n            <td>{{result.jornada}}</td>\r\n            <td>{{result.casa}}</td>\r\n            <td>{{result.golesCasa}}</td>\r\n            <td>{{result.golesVisita}}</td>\r\n            <td>{{result.visita}}</td>\r\n          </tr>\r\n        </table>\r\n      </div>\r\n      <div class=\"col-sm-7\">\r\n\r\n        <mat-card class=\"tab\">\r\n          <mat-card-content>\r\n            <mat-tab-group class=\"demo-tab-group\">\r\n              <mat-tab label=\"Plantel\">\r\n                <table class=\"table\">\r\n                  <tr>\r\n                    <th>Nombre</th>\r\n                    <th>Apellido</th>\r\n                    <th>#</th>\r\n                    <th>Fecha de Nacimiento</th>\r\n                    <th>Nacionalidad</th>\r\n                    <th>Posicion</th>\r\n                  </tr>\r\n                  <tr *ngFor=\"let jugador of info.jugadores\">\r\n                    <td>{{jugador.nombre}}</td>\r\n                    <td>{{jugador.apellido}}</td>\r\n                    <td>{{jugador.numero}}</td>\r\n                    <td>{{jugador.fechaNacimiento | date:'shortDate'}}</td>\r\n                    <td>{{jugador.nacionalidad}}</td>\r\n                    <td>{{jugador.posicion}}</td>\r\n                  </tr>\r\n                </table>\r\n              </mat-tab>\r\n              <mat-tab label=\"Goleo\">\r\n                <div class=\"demo-tab-content\">\r\n                  Goleadores del equipo\r\n                  <table class=\"table\">\r\n                    <tr>\r\n                      <th>Nombre</th>\r\n                      <th>Equipo</th>\r\n                      <th>Goles</th>\r\n                      <th>Pie</th>\r\n                      <th>Cabeza</th>\r\n                      <th>Falta</th>\r\n                      <th>Penal</th>\r\n                    </tr>\r\n                    <tr *ngFor=\"let goleo of goleo.goleadores\">\r\n                      <td *ngIf=\"goleo.equipo === 'SAN'\">{{goleo.nombre}}</td>\r\n                      <td *ngIf=\"goleo.equipo === 'SAN'\">{{goleo.equipo}}</td>\r\n                      <td *ngIf=\"goleo.equipo === 'SAN'\">{{goleo.goles}}</td>\r\n                      <td *ngIf=\"goleo.equipo === 'SAN'\">{{goleo.pie}}</td>\r\n                      <td *ngIf=\"goleo.equipo === 'SAN'\">{{goleo.cabeza}}</td>\r\n                      <td *ngIf=\"goleo.equipo === 'SAN'\">{{goleo.falta}}</td>\r\n                      <td *ngIf=\"goleo.equipo === 'SAN'\">{{goleo.penal}}</td>\r\n                    </tr>\r\n                  </table>\r\n                </div>\r\n              </mat-tab>\r\n              <mat-tab label=\"Historia\">\r\n                <div class=\"demo-tab-content\">\r\n                  {{info.historia}}\r\n                </div>\r\n              </mat-tab>\r\n            </mat-tab-group>\r\n          </mat-card-content>\r\n        </mat-card>\r\n\r\n      </div>\r\n\r\n    </div>\r\n\r\n  </div>\r\n\r\n</body>\r\n\r\n</html>"

