module.exports = "<html lang=\"en\">\r\n\r\n<head>\r\n  <title>Grecia</title>\r\n  <meta charset=\"utf-8\">\r\n  <meta name=\"viewport\" content=\"width=device-width, initial-scale=1\">\r\n  <link href=\"https://fonts.googleapis.com/css?family=Vollkorn\" rel=\"stylesheet\">\r\n  <link href=\"https://fonts.googleapis.com/css?family=Cutive\" rel=\"stylesheet\">\r\n  <link href=\"https://fonts.googleapis.com/css?family=Raleway\" rel=\"stylesheet\">\r\n  <link href=\"https://fonts.googleapis.com/css?family=Roboto\" rel=\"stylesheet\">\r\n  <script src=\"https://ajax.googleapis.com/ajax/libs/jquery/3.3.1/jquery.min.js\"></script>\r\n  <script src=\"https://maxcdn.bootstrapcdn.com/bootstrap/3.3.7/js/bootstrap.min.js\"></script>\r\n  <link rel=\"stylesheet\" href=\"https://cdnjs.cloudflare.com/ajax/libs/font-awesome/4.7.0/css/font-awesome.min.css\">\r\n  <link rel=\"stylesheet\" href=\"https://maxcdn.bootstrapcdn.com/bootstrap/3.3.7/css/bootstrap.min.css\">\r\n</head>\r\n\r\n<body>\r\n\r\n  <div class=\"container-fluid\">\r\n\r\n    <div class=\"row \">\r\n      <div class=\"col-sm-3\">\r\n\r\n        <img class=\"displayed focus pic\" src=\"assets/img/saprissalogo.png\" style=\"width:200px; height:200px\">\r\n\r\n      </div>\r\n      <div class=\"col-sm-6\">\r\n\r\n        <div class=\"row text-center\">\r\n          <h2 class=\"grecia\">{{info.nombre}} </h2>\r\n          <p class=\"grecia\">{{info.sigla}}</p>\r\n        </div>\r\n\r\n        <div class=\"container\">\r\n          <div class=\"row\">\r\n            <div class=\"col-sm-2\">\r\n              <div class=\"cuadro_intro_hover \" style=\"background-color:#cccccc;\">\r\n                <p style=\"text-align:center;\">\r\n                  <img src=\"https://image.ibb.co/gcyZgJ/DSC_0388_e1472162658321_750x422.jpg\" alt=\"280517_Grecia_Full1\" class=\"img-responsive\">\r\n                </p>\r\n                <div class=\"caption\">\r\n                  <div class=\"blur\"></div>\r\n                  <div class=\"caption-text\">\r\n                    <h3 style=\"border-top:2px solid white; border-bottom:2px solid white; padding:10px;\">Estadio</h3>\r\n                    <p>{{info.estadio}}</p>\r\n                  </div>\r\n                </div>\r\n              </div>\r\n\r\n            </div>\r\n            <div class=\"col-sm-2\">\r\n              <div class=\"cuadro_intro_hover \" style=\"background-color:#cccccc;\">\r\n                <p style=\"text-align:center;\">\r\n                  <img src=\"https://image.ibb.co/jCGNDy/trofeo.jpg\" alt=\"trofeo\" class=\"img-responsive\">\r\n                </p>\r\n                <div class=\"caption\">\r\n                  <div class=\"blur\"></div>\r\n                  <div class=\"caption-text\">\r\n                    <h3 style=\"border-top:2px solid white; border-bottom:2px solid white; padding:10px;\">Titulos</h3>\r\n                    <p>{{info.titulos}}</p>\r\n                  </div>\r\n                </div>\r\n              </div>\r\n\r\n            </div>\r\n            <div class=\"col-sm-2\">\r\n              <div class=\"cuadro_intro_hover\" style=\"background-color:#cccccc;\">\r\n                <p style=\"text-align:center;\">\r\n                  <img src=\"https://image.ibb.co/hgxSiy/5_QOOUE274_RD5_JAJFB42_Y7_NCYBY.jpg\" alt=\"2754548\" class=\"img-responsive\">\r\n                </p>\r\n                <div class=\"caption\">\r\n                  <div class=\"blur\"></div>\r\n                  <div class=\"caption-text\">\r\n                    <h3 style=\"border-top:2px solid white; border-bottom:2px solid white; padding:10px;\">DT</h3>\r\n                    <p>{{info.dt}}</p>\r\n                  </div>\r\n                </div>\r\n              </div>\r\n\r\n            </div>\r\n          </div>\r\n        </div>\r\n\r\n      </div>\r\n      <div class=\"col-sm-3\">\r\n        <div class=\"row text-center\">\r\n          <a href=\"https://www.facebook.com/Saprissaoficial/\" target=\"_blank\" class=\"fa fa-facebook\"></a>\r\n          <a href=\"https://twitter.com/SaprissaOficial?lang=es\" target=\"_blank\" class=\"fa fa-twitter\"></a>\r\n          <a href=\"https://www.instagram.com/deportivo_saprissa/\" target=\"_blank\" class=\"fa fa-instagram\"></a>\r\n        </div>\r\n      </div>\r\n    </div>\r\n\r\n    <div style=\"padding-top: 50px\" class=\"row\">\r\n      <div class=\"col-sm-5\">\r\n        <table class=\"table\">\r\n          <tr>\r\n            <th>Jornada</th>\r\n            <th>Equipo Local</th>\r\n            <th>Goles</th>\r\n            <th>Goles</th>\r\n            <th>Equipo visita</th>\r\n          </tr>\r\n          <tr *ngFor=\"let result of resultados.resultados\">\r\n            <td>{{result.jornada}}</td>\r\n            <td>{{result.casa}}</td>\r\n            <td>{{result.golesCasa}}</td>\r\n            <td>{{result.golesVisita}}</td>\r\n            <td>{{result.visita}}</td>\r\n          </tr>\r\n        </table>\r\n      </div>\r\n      <div class=\"col-sm-7\">\r\n\r\n        <mat-card class=\"tab\">\r\n          <mat-card-content>\r\n            <mat-tab-group class=\"demo-tab-group\">\r\n              <mat-tab label=\"Plantel\">\r\n                <table class=\"table\">\r\n                  <tr>\r\n                    <th>Nombre</th>\r\n                    <th>Apellido</th>\r\n                    <th>#</th>\r\n                    <th>Fecha de Nacimiento</th>\r\n                    <th>Nacionalidad</th>\r\n                    <th>Posicion</th>\r\n                  </tr>\r\n                  <tr *ngFor=\"let jugador of info.jugadores\">\r\n                    <td>{{jugador.nombre}}</td>\r\n                    <td>{{jugador.apellido}}</td>\r\n                    <td>{{jugador.numero}}</td>\r\n                    <td>{{jugador.fechaNacimiento | date:'shortDate'}}</td>\r\n                    <td>{{jugador.nacionalidad}}</td>\r\n                    <td>{{jugador.posicion}}</td>\r\n                  </tr>\r\n                </table>\r\n              </mat-tab>\r\n              <mat-tab label=\"Goleo\">\r\n                <div class=\"demo-tab-content\">\r\n                  Goleadores del equipo\r\n                  <table class=\"table\">\r\n                    <tr>\r\n                      <th>Nombre</th>\r\n                      <th>Goles</th>\r\n                      <th>Pie</th>\r\n                      <th>Cabeza</th>\r\n                      <th>Falta</th>\r\n                      <th>Penal</th>\r\n                    </tr>\r\n                    <tr *ngFor=\"let goleo of goleo.goleadores\">\r\n                      <td *ngIf=\"goleo.equipo === 'SAP'\">{{goleo.nombre}}</td>\r\n                      <td *ngIf=\"goleo.equipo === 'SAP'\">{{goleo.goles}}</td>\r\n                      <td *ngIf=\"goleo.equipo === 'SAP'\">{{goleo.pie}}</td>\r\n                      <td *ngIf=\"goleo.equipo === 'SAP'\">{{goleo.cabeza}}</td>\r\n                      <td *ngIf=\"goleo.equipo === 'SAP'\">{{goleo.falta}}</td>\r\n                      <td *ngIf=\"goleo.equipo === 'SAP'\">{{goleo.penal}}</td>\r\n                    </tr>\r\n                  </table>\r\n                </div>\r\n              </mat-tab>\r\n              <mat-tab label=\"Historia\">\r\n                <div class=\"demo-tab-content\">\r\n                  {{info.historia}}\r\n                </div>\r\n              </mat-tab>\r\n            </mat-tab-group>\r\n          </mat-card-content>\r\n        </mat-card>\r\n\r\n      </div>\r\n\r\n    </div>\r\n\r\n  </div>\r\n\r\n</body>\r\n\r\n</html>"

